import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder attribute as selector
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type a partial search term to trigger autocomplete
    const searchInput = await page.$('input[placeholder="Search Amazon"]');
    await searchInput.click();
    await searchInput.type('iph');

    // Wait for the suggestions dropdown to appear (by ID or class)
    // Try by ID first, fallback to class
    let suggestionsSelector;
    if (await page.$('#searchSuggestions')) {
      suggestionsSelector = '#searchSuggestions';
    } else {
      // fallback: look for .search-suggestions
      suggestionsSelector = '.search-suggestions';
    }
    await page.waitForSelector(suggestionsSelector, { timeout: 5000 });

    // Take screenshot of suggestions
    const step2 = path.join(screenshotsDir, 'step_2_suggestions.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract suggestion items' text
    const suggestionItems = await page.$$eval(
      `${suggestionsSelector} .suggestion-item`,
      els => els.map(e => e.textContent.trim()).filter(Boolean)
    );

    // Click the first suggestion if available
    if (suggestionItems.length > 0) {
      await page.click(`${suggestionsSelector} .suggestion-item`);
      // Wait for search results to load (look for .search-results or .results-count)
      await page.waitForSelector('.search-results,.results-count', { timeout: 5000 });
    }

    // Take screenshot after suggestion selection
    const step3 = path.join(screenshotsDir, 'step_3_after_select.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the search results count if available
    let resultsCount = null;
    if (await page.$('.results-count')) {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    }

    // Extract the search input value after selection
    const searchInputValue = await page.$eval('input[placeholder="Search Amazon"]', el => el.value);

    return {
      success: true,
      action: "Tested search autocomplete: typed partial term, captured suggestions, selected first suggestion, and verified results.",
      extractedData: {
        suggestions: suggestionItems,
        selectedSuggestion: suggestionItems[0] || null,
        searchInputValue,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
